import React from 'react'

const Login = () => {
  return (
    <div>
        <form>
            <input className="uname-input login-input"  onChange={onChangeLogin}  value={gmail} type="text"  name="username"/>
            <input className="pwd-input login-input"  onChange={onChangeLogin}  value={password} type="text"  name="password"  />
        </form>
    </div>
  )
}

export default Login
